import React from 'react';
function User(props) {
    
    function handleClick(){
        alert(props.iduser)
    }

    return ( 
        <span>
            <h1 onClick={handleClick}>{props.nameuser}</h1>
            <input type="button" value="Hello   " />  
        </span>
        
     );
}

export default User;
